INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2024/12/31 11:59:59", 119901, 1, "ミヤコ（クリスマス）", "みやこ", 119901, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 119901, 302, 0, "2024/12/22 12:00:00", 0, 1, 0, 14, 0, 2.17, 119901, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/03/28 11:59:59", 120001, 5, "シズル（ノワール）", "しずる", 120001, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 120001, 190, 0, "2024/03/22 12:00:00", 0, 1, 0, 6, 0, 2.375, 120001, 3, 0, 1, 0, 450);
