INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2025/01/20 11:59:59", 120701, 22, "シェフィ（ニューイヤー）", "しぇふぃ", 120701, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 120701, 283, 0, "2025/01/15 15:00:00", 0, 1, 0, 1, 0, 1.84, 120701, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 120801, 22, "ルカ（ニューイヤー）", "るか", 120801, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 120801, 193, 0, "2023/10/16 15:00:00", 0, 1, 0, 2, 0, 1.3, 120801, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2025/01/20 11:59:59", 120901, 38, "イリヤ（ニューイヤー）", "いりや", 120901, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 120901, 424, 0, "2025/01/15 15:00:00", 0, 1, 0, 12, 0, 1.425, 120901, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/02/29 11:59:59", 121001, 41, "ペコリーヌ（オーバーロード）", "ぺこりーぬ", 121001, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 121001, 164, 0, "2024/02/22 12:00:00", 0, 1, 0, 1, 0, 2.25, 121001, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/02/29 11:59:59", 121101, 42, "キャル（オーバーロード）", "きゃる", 121101, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 121101, 588, 0, "2024/02/22 12:00:00", 0, 1, 0, 1, 0, 2.07, 121101, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 121201, 40, "ラビリスタ（オーバーロード）", "らびりすた", 121201, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 121201, 260, 0, "2023/11/16 15:00:00", 0, 1, 0, 6, 0, 1.55, 121201, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2030/12/31 15:00:00", 121301, 3, "クルミ（ステージ）", "くるみ", 121301, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 121301, 731, 0, "2022/03/03 19:00:00", 0, 0, 0, 3, 0, 1.9, 121301, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 121401, 7, "ミサキ（ステージ）", "みさき", 121401, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 121401, 742, 0, "2022/03/15 15:00:00", 0, 0, 0, 15, 0, 2.27, 121401, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, "2024/04/15 14:59:59", 121501, 6, "アユミ（怪盗）", "あゆみ", 121501, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 121501, 590, 0, "2024/04/12 12:00:00", 0, 1, 0, 12, 0, 2.0, 121501, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2030/12/31 15:00:00", 121601, 3, "イノリ（怪盗）", "いのり", 121601, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 121601, 292, 0, "2022/04/15 15:00:00", 0, 0, 0, 17, 0, 1.425, 121601, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2030/12/31 15:00:00", 121701, 0, "アキノ（アキノ＆サレン）", "あきの", 121701, "", 0, 421, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 180901, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2030/12/31 15:00:00", 121801, 0, "サレン（アキノ＆サレン）", "されん", 121801, "", 0, 421, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 180901, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2030/12/31 15:00:00", 121901, 5, "アンナ（パイレーツ）", "あんな", 121901, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 121901, 293, 0, "2022/05/15 15:00:00", 0, 0, 0, 12, 0, 2.125, 121901, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2030/12/31 15:00:00", 122001, 3, "シノブ（パイレーツ）", "しのぶ", 122001, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 122001, 380, 0, "2022/05/03 19:00:00", 0, 0, 0, 14, 0, 1.425, 122001, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (35, "2030/12/31 15:00:00", 122101, 35, "アオイ（キャンプ）", "あおい", 122101, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 122101, 731, 0, "2024/04/18 15:00:00", 0, 1, 0, 9, 0, 1.97, 122101, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 122201, 4, "ユカリ（キャンプ）", "ゆかり", 122201, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 122201, 419, 0, "2022/05/31 12:00:00", 0, 0, 0, 8, 0, 1.84, 122201, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (43, "2030/12/31 15:00:00", 122301, 43, "ヴァンピィ", "うぁんぴぃ", 122301, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 122301, 564, 0, "2022/06/15 15:00:00", 0, 0, 0, 0, 0, 1.425, 122301, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 122401, 1, "ヒヨリ（サマー）", "ひより", 122401, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 122401, 264, 0, "2024/06/17 15:00:00", 0, 1, 0, 8, 0, 2.42, 122401, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2024/08/31 11:59:59", 122501, 4, "レイ（サマー）", "れい", 122501, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 122501, 250, 0, "2024/08/26 19:00:00", 0, 1, 0, 0, 0, 1.965, 122501, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 122601, 7, "ユイ（サマー）", "ゆい", 122601, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 122601, 554, 0, "2022/07/15 15:00:00", 0, 0, 0, 0, 0, 2.27, 122601, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 122701, 7, "キョウカ（サマー）", "きょうか", 122701, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 122701, 812, 0, "2022/08/15 15:00:00", 0, 0, 0, 0, 0, 1.92, 122701, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 122801, 1, "ミソギ（サマー）", "みそぎ", 122801, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 122801, 237, 0, "2024/07/16 15:00:00", 0, 1, 0, 0, 0, 2.295, 122801, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/08/31 11:59:59", 122901, 5, "ミミ（サマー）", "みみ", 122901, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 122901, 361, 0, "2024/08/26 19:00:00", 0, 1, 0, 0, 0, 2.25, 122901, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (44, "2025/01/03 18:59:59", 123001, 44, "アメス", "あめす", 123001, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 123001, 746, 0, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 2.27, 123001, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 123101, 7, "マホ（エクスプローラー）", "まほ", 123101, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 123101, 793, 0, "2022/09/03 19:00:00", 0, 0, 0, 0, 0, 1.795, 123101, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2030/12/31 15:00:00", 123201, 3, "アヤネ（エクスプローラー）", "あやね", 123201, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 123201, 256, 0, "2022/09/15 15:00:00", 0, 0, 0, 0, 0, 1.425, 123201, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2024/09/30 11:59:59", 123301, 0, "ネア", "ねあ", 123301, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 123301, 350, 0, "2024/09/25 12:00:00", 0, 1, 0, 0, 0, 1.62, 123301, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2030/12/31 15:00:00", 123401, 5, "ジュン（キャンプ）", "じゅん", 123401, "", 0, 0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, "2030/12/31 15:00:00", 123501, 6, "リン（ハロウィン）", "りん", 123501, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 123501, 583, 0, "2024/09/17 15:00:00", 0, 1, 0, 0, 0, 2.34, 123501, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2024/10/28 11:59:59", 123601, 4, "トモ（ハロウィン）", "とも", 123601, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 123601, 262, 0, "2024/10/24 12:00:00", 0, 1, 0, 0, 0, 1.965, 123601, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 123701, 21, "ナナカ（ハロウィン）", "ななか", 123701, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 123701, 741, 0, "2022/10/15 15:00:00", 0, 0, 0, 0, 0, 2.07, 123701, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2024/11/30 11:59:59", 123801, 1, "クリスティーナ（ワイルド）", "くりすてぃーな", 123801, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 123801, 238, 0, "2024/11/26 12:00:00", 0, 1, 0, 0, 0, 2.295, 123801, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (2, "2030/12/31 15:00:00", 123901, 2, "マツリ（ワイルド）", "まつり", 123901, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 123901, 183, 0, "2022/11/15 15:00:00", 0, 0, 0, 0, 0, 2.125, 123901, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/12/31 11:59:59", 124001, 7, "アカリ（クリスマス）", "あかり", 124001, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 124001, 438, 0, "2024/12/22 12:00:00", 0, 1, 0, 0, 0, 2.07, 124001, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, "2030/12/31 15:00:00", 124101, 6, "ヨリ（クリスマス）", "より", 124101, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 124101, 433, 0, "2024/11/16 15:00:00", 0, 1, 0, 0, 0, 1.965, 124101, 1, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2030/12/31 15:00:00", 124201, 5, "ジュン（クリスマス）", "じゅん", 124201, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 124201, 144, 0, "2022/12/23 12:00:00", 0, 0, 0, 0, 0, 2.07, 124201, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2030/12/31 15:00:00", 124301, 0, "アン（アン＆グレア）", "あん", 124301, "", 0, 577, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 181001, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2030/12/31 15:00:00", 124401, 0, "グレア（アン＆グレア）", "ぐれあ", 124401, "", 0, 577, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 181001, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2025/01/20 11:59:59", 124501, 21, "ホマレ（ニューイヤー）", "ほまれ", 124501, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 124501, 707, 0, "2025/01/15 15:00:00", 0, 1, 0, 0, 0, 2.07, 124501, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2025/01/20 11:59:59", 124601, 21, "ミサト（ニューイヤー）", "みさと", 124601, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 124601, 698, 0, "2025/01/15 15:00:00", 0, 1, 0, 0, 0, 2.44, 124601, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 124701, 46, "ミツキ（ニューイヤー）", "みつき", 124701, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 124701, 590, 0, "2024/12/16 15:00:00", 0, 1, 0, 0, 0, 2.24, 124701, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2024/02/14 23:59:59", 124801, 0, "ノゾミ（リベレイター）", "のぞみ", 124801, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 124801, 423, 0, "2024/02/12 12:00:00", 0, 1, 0, 0, 0, 2.14, 124801, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 124901, 0, "カヤ（リベレイター）", "かや", 124901, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 124901, 170, 0, "2025/01/16 15:00:00", 0, 1, 0, 0, 0, 1.965, 124901, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/02/14 23:59:59", 125001, 0, "ムイミ（リベレイター）", "むいみ", 125001, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 125001, 221, 0, "2024/02/12 12:00:00", 0, 1, 0, 0, 0, 1.965, 125001, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (8, "2030/12/31 15:00:00", 125101, 47, "タマキ（カフェ）", "たまき", 125101, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 125101, 825, 0, "2023/03/03 19:00:00", 0, 0, 0, 0, 0, 2.24, 125101, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 125201, 4, "モニカ（カフェ）", "もにか", 125201, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 125201, 463, 0, "2023/03/10 12:00:00", 0, 0, 0, 0, 0, 1.965, 125201, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, "2024/04/15 14:59:59", 125301, 6, "コッコロ（レンジャー）", "こっころ", 125301, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 125301, 752, 0, "2024/04/12 12:00:00", 0, 1, 0, 0, 0, 2.07, 125301, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (8, "2030/12/31 15:00:00", 125401, 8, "シオリ（レンジャー）", "しおり", 125401, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 125401, 710, 0, "2023/04/10 12:00:00", 0, 0, 0, 0, 0, 2.09, 125401, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/05/15 14:59:59", 125501, 50, "ジータ（ウォーロック）", "じーた", 125501, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 125501, 443, 0, "2024/05/10 12:00:00", 0, 1, 0, 0, 0, 1.92, 125501, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (51, "2024/05/15 14:59:59", 125601, 0, "ビカラ", "びから", 125601, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 125601, 267, 0, "2024/05/10 12:00:00", 0, 1, 0, 0, 0, 2.09, 125601, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 125701, 9, "カリン（アルケミスト）", "かりん", 125701, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 125701, 579, 1, "2023/04/30 12:00:00", 0, 1, 0, 0, 0, 2.24, 125701, 1, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2030/12/31 15:00:00", 125801, 0, "リリ（フォールン）", "りり", 125801, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 125801, 464, 0, "2023/04/17 12:00:00", 0, 0, 0, 0, 0, 2.09, 125801, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 125901, 1, "カヤ（リベレイター）", "かや", 125901, "", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2030/12/31 15:00:00", 126001, 0, "クリア（フォールン）", "くりあ", 126001, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 126001, 406, 0, "2023/10/31 12:00:00", 0, 0, 0, 0, 0, 2.09, 126001, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (44, "2030/12/31 15:00:00", 126101, 53, "プレシア（フォールン）", "ぷれしあ", 126101, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 126101, 480, 0, "2023/11/15 15:00:00", 0, 0, 0, 0, 0, 2.09, 126101, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2024/06/15 14:59:59", 126201, 3, "イリヤ（儀装束）", "いりや", 126201, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 126201, 568, 0, "2024/06/10 12:00:00", 0, 1, 0, 0, 0, 2.09, 126201, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 126301, 9, "ユキ（儀装束）", "ゆき", 126301, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 126301, 456, 0, "2023/06/15 15:00:00", 0, 0, 0, 0, 0, 2.07, 126301, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2025/01/03 18:59:59", 126401, 1, "クローチェ", "くろーちぇ", 126401, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 126401, 373, 0, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 126401, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2025/01/03 18:59:59", 126501, 0, "ライラエル", "らいらえる", 126501, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 126501, 740, 0, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 1.965, 126501, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/07/15 14:59:59", 126601, 7, "ネネカ（サマー）", "ねねか", 126601, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 126601, 650, 0, "2024/07/11 12:00:00", 0, 1, 0, 0, 0, 2.04, 126601, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2030/12/31 15:00:00", 126701, 5, "アキノ（サマー）", "あきの", 126701, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 126701, 224, 1, "2023/06/30 12:00:00", 0, 1, 0, 0, 0, 1.965, 126701, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2030/12/31 15:00:00", 126801, 5, "ユカリ（サマー）", "ゆかり", 126801, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 126801, 159, 0, "2023/07/15 15:00:00", 0, 0, 0, 0, 0, 1.97, 126801, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/08/12 11:59:59", 126901, 21, "ランファ（サマー）", "らんふぁ", 126901, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 126901, 682, 0, "2024/08/09 12:00:00", 0, 1, 0, 0, 0, 1.965, 126901, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (2, "2023/08/14 20:59:59", 127001, 52, "クウカ（サマー）", "くうか", 127001, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 127001, 133, 1, "2023/07/31 12:00:00", 0, 1, 0, 0, 0, 1.97, 127001, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/08/12 11:59:59", 127101, 46, "シノブ（サマー）", "しのぶ", 127101, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 127101, 255, 0, "2024/08/09 12:00:00", 0, 1, 0, 0, 0, 2.09, 127101, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/10/13 11:59:59", 127201, 7, "キャル（編入生）", "きゃる", 127201, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 127201, 804, 0, "2024/10/10 12:00:00", 0, 1, 0, 0, 0, 2.09, 127201, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (8, "2030/12/31 15:00:00", 127301, 8, "スズナ（編入生）", "すずな", 127301, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 127301, 750, 0, "2023/09/15 15:00:00", 0, 0, 0, 0, 0, 2.09, 127301, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 127401, 1, "ビカラ（コラボ）", "びから", 127401, "", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2024/11/18 11:59:59", 127501, 4, "サレン（サラサリア）", "されん", 127501, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 127501, 304, 0, "2024/11/11 12:00:00", 0, 1, 0, 0, 0, 2.09, 127501, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 127601, 4, "ルカ（サラサリア）", "るか", 127601, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 127601, 157, 0, "2023/10/15 15:00:00", 0, 0, 0, 0, 0, 1.965, 127601, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, "2030/12/31 15:00:00", 127701, 48, "リンド", "りんど", 127701, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 127701, 693, 0, "2024/10/10 12:00:00", 0, 0, 0, 0, 0, 1.965, 127701, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 127801, 47, "ヴルム", "うるむ", 127801, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 127801, 706, 0, "2024/10/18 12:00:00", 0, 0, 0, 0, 0, 1.965, 127801, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/12/15 14:59:59", 127901, 5, "ペコリーヌ（クリスマス）", "ぺこりーぬ", 127901, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 127901, 372, 0, "2024/12/09 12:00:00", 0, 1, 0, 0, 0, 1.965, 127901, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (35, "2030/12/31 15:00:00", 128001, 35, "クレジッタ（クリスマス）", "くれじった", 128001, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 128001, 723, 0, "2023/12/15 15:00:00", 0, 0, 0, 0, 0, 2.09, 128001, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2030/12/31 15:00:00", 128101, 0, "シズル（シズル&リノ）", "しずる", 128101, "", 0, 580, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 181101, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2030/12/31 15:00:00", 128201, 0, "リノ（シズル&リノ）", "りの", 128201, "", 0, 580, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 181101, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, "2030/12/31 15:00:00", 128301, 38, "イノリ（ニューイヤー）", "いのり", 128301, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 128301, 191, 1, "2023/12/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 128301, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2025/01/15 14:59:59", 128401, 21, "ハツネ（ニューイヤー）", "はつね", 128401, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 128401, 801, 0, "2025/01/09 12:00:00", 0, 1, 0, 0, 0, 2.09, 128401, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2025/01/15 14:59:59", 128501, 21, "カスミ（ニューイヤー）", "かすみ", 128501, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 128501, 739, 0, "2025/01/09 12:00:00", 0, 1, 0, 0, 0, 2.09, 128501, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 128601, 1, "リリ（フォールン）", "りり", 128601, "", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2025/02/15 14:59:59", 128701, 0, "ヒヨリ（アストラル）", "ひより", 128701, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 128701, 226, 0, "2025/02/10 12:00:00", 0, 1, 0, 0, 0, 2.09, 128701, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 128801, 0, "レイ（アストラル）", "れい", 128801, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 128801, 194, 1, "2024/01/31 12:00:00", 0, 1, 0, 0, 0, 1.965, 128801, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2025/02/15 14:59:59", 128901, 0, "ユイ（アストラル）", "ゆい", 128901, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 128901, 772, 0, "2025/02/10 12:00:00", 0, 1, 0, 0, 0, 2.09, 128901, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2025/01/03 18:59:59", 129001, 0, "エリス", "えりす", 129001, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 129001, 800, 0, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 129001, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/09/30 11:59:59", 129301, 7, "ユニ（ウィンター）", "ゆに", 129301, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 129301, 708, 0, "2024/09/25 12:00:00", 0, 1, 0, 0, 0, 2.09, 129301, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (2, "2030/12/31 15:00:00", 129401, 2, "クロエ（ウィンター）", "くろえ", 129401, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 129401, 188, 0, "2024/03/18 12:00:00", 0, 0, 0, 0, 0, 2.09, 129401, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2024/12/22 11:59:59", 129501, 1, "チエル（ウィンター）", "ちえる", 129501, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 129501, 247, 0, "2024/12/15 15:00:00", 0, 1, 0, 0, 0, 2.09, 129501, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2025/01/03 18:59:59", 129601, 0, "アネモネ", "あねもね", 129601, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 129601, 550, 0, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 129601, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2025/01/03 18:59:59", 129701, 0, "ネフィ＝ネラ", "ねふぃーねら", 129701, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 129701, 540, 0, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 129701, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/10/18 11:59:59", 129801, 5, "マコト（コマンダー）", "まこと", 129801, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 129801, 269, 0, "2024/10/13 12:00:00", 0, 1, 0, 0, 0, 2.09, 129801, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, "2030/12/31 15:00:00", 129901, 48, "エリコ（コマンダー）", "えりこ", 129901, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 129901, 294, 0, "2024/04/15 15:00:00", 0, 0, 0, 0, 0, 1.84, 129901, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2024/11/18 11:59:59", 130001, 0, "ヤマト", "やまと", 130001, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 130001, 150, 0, "2024/11/11 12:00:00", 0, 1, 0, 0, 0, 2.09, 130001, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/11/26 11:59:59", 130101, 9, "ワカナ", "わかな", 130101, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 130101, 535, 0, "2024/11/18 12:00:00", 0, 1, 0, 0, 0, 2.09, 130101, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2024/11/11 11:59:59", 130201, 0, "フブキ", "ふぶき", 130201, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 130201, 371, 0, "2024/10/31 12:00:00", 0, 1, 0, 0, 0, 1.84, 130201, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 130601, 1, "レイ（アストラル）", "れい", 130601, "", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/11/18 11:59:59", 130701, 7, "キョウカ（スプリング）", "きょうか", 130701, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 130701, 563, 0, "2024/11/11 12:00:00", 0, 1, 0, 0, 0, 1.92, 130701, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 130801, 7, "スズメ（スプリング）", "すずめ", 130801, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 130801, 558, 0, "2024/05/15 15:00:00", 0, 0, 0, 0, 0, 1.84, 130801, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 130901, 7, "クルル", "くるる", 130901, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 130901, 440, 0, "2024/06/15 15:00:00", 0, 0, 0, 0, 0, 2.09, 130901, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/12/15 14:59:59", 131001, 7, "マホ（ドリームパーク）", "まほ", 131001, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 131001, 702, 0, "2024/12/09 12:00:00", 0, 1, 0, 0, 0, 1.84, 131001, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (2, "2030/12/31 15:00:00", 131101, 52, "ネア（サマー）", "ねあ", 131101, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 131101, 165, 0, "2024/06/30 12:00:00", 0, 0, 0, 0, 0, 2.09, 131101, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (35, "2025/01/15 14:59:59", 131201, 35, "ミソラ（サマー）", "みそら", 131201, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 131201, 753, 0, "2025/01/09 12:00:00", 0, 1, 0, 0, 0, 2.09, 131201, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 131301, 1, "リリ", "りり", 131301, "", 0, 0, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 131401, 1, "クリア", "くりあ", 131401, "", 0, 0, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, "2030/12/31 15:00:00", 131501, 1, "プレシア", "ぷれしあ", 131501, "", 0, 0, 1, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2025/01/15 14:59:59", 131601, 4, "リリ（サマー）", "りり", 131601, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 131601, 399, 0, "2025/01/09 12:00:00", 0, 1, 0, 0, 0, 1.92, 131601, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (44, "2025/02/15 14:59:59", 131701, 53, "アメス（サマー）", "あめす", 131701, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 131701, 743, 0, "2025/02/10 12:00:00", 0, 1, 0, 0, 0, 1.92, 131701, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 131801, 21, "ホマレ（サマー）", "ほまれ", 131801, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 131801, 709, 0, "2024/08/15 15:00:00", 0, 0, 0, 0, 0, 2.09, 131801, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2030/12/31 15:00:00", 131901, 23, "エミリア（サマー）", "えみりあ", 131901, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 131901, 725, 1, "2024/08/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 131901, 1, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/09/25 11:59:59", 132001, 21, "エキドナ（サマー）", "えきどな", 132001, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 132001, 775, 0, "2024/09/13 12:00:00", 0, 1, 0, 0, 0, 2.09, 132001, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (13, "2024/09/13 11:59:59", 132101, 24, "レム（サマー）", "れむ", 132101, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 132101, 146, 0, "2024/08/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 132101, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/10/10 11:59:59", 132201, 7, "ノゾミ（アルケミスト）", "のぞみ", 132201, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 132201, 721, 0, "2024/09/30 12:00:00", 0, 1, 0, 0, 0, 1.84, 132201, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, "2024/12/09 11:59:59", 132801, 0, "ライラエル（クリスマス）", "らいらえる", 132801, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 132801, 750, 0, "2024/11/30 12:00:00", 0, 1, 0, 0, 0, 2.09, 132801, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2030/12/31 15:00:00", 132901, 46, "イオ（クリスマス）", "いお", 132901, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 132901, 748, 0, "2024/12/09 12:00:00", 0, 0, 0, 0, 0, 2.09, 132901, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2025/01/03 18:59:59", 133001, 0, "グレイス", "ぐれいす", 133001, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 133001, 234, 0, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 133001, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2030/12/31 15:00:00", 133201, 22, "モニカ（ニューイヤー）", "もにか", 133201, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 133201, 296, 1, "2024/12/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 133201, 1, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, "2025/01/15 14:59:59", 133501, 22, "サレン（ニューイヤー）", "されん", 133501, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 133501, 718, 0, "2025/01/03 19:00:00", 0, 1, 0, 0, 0, 2.09, 133501, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "2025/01/31 11:59:59", 133601, 0, "メドゥーサ", "めどぅーさ", 133601, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 133601, 445, 0, "2025/01/20 12:00:00", 0, 1, 0, 0, 0, 2.09, 133601, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (8, "2025/02/10 11:59:59", 133701, 0, "ラビリスタ（アルファ）", "らびりすた", 133701, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 133701, 717, 0, "2025/01/31 12:00:00", 0, 1, 0, 0, 0, 2.09, 133701, 3, 0, 2, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, "2025/02/20 11:59:59", 133901, 0, "クリスティーナ（アルファ）", "くりすてぃーな", 133901, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 133901, 228, 0, "2025/02/10 12:00:00", 0, 1, 0, 0, 0, 2.09, 133901, 3, 0, 1, 0, 450);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, "2030/12/31 15:00:00", 134101, 1, "フブキ", "ふぶき", 134101, "", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, 0, 0, 0, 0.0, 0, 3, 0, 0, 0, 0);
